import React from "react";
import PropTypes from "prop-types";

const Modal = props => {
  if (!props.show) {
    return null;
  }
  return (
    <div className='modal' onClick={props.onClose}>
      <div className='modal-content' onClick={e => e.stopPropagation()}>
        <div className='grid-container'>
          <div className='Ambulance emergencyicon'>
            <img src='/icons/incident/Medical.png' alt='' />
            <h4>Ambulance</h4>
          </div>
          <div className='Police emergencyicon'>
            <img src='/icons/incident/Crime.png' alt='' />
            <h4>Police</h4>
          </div>
          <div className='Fire emergencyicon'>
            <img src='/icons/incident/Fire.png' alt='' />
            <h4>Fire</h4>
          </div>
          <div className='General emergencyicon'>
            <img src='/icons/incident/Call.png' alt='' />
            <h4>General</h4>
          </div>
          <div className='Corona'>
            {/* <img src='/icons/incident/Corona.png' alt='' /> */}
            <h4>Corona</h4>
          </div>
        </div>
        {/* 
        <div className='modal-footer'>
          <button onClick={props.onClose} className='btn btn-primary'>
            close
          </button>
        </div> */}
      </div>
    </div>
  );
};

Modal.propTypes = {};

export default Modal;
